      .then(res => setProperties(res))
      .catch(err => console.log(err))
    }

    fetchData()
  })

  return (
    <div className="App">
        <Header />
        <h1>Properties list</h1>
        <span>{JSON.stringify(properties)}</span>       
    </div>
